import React from "react";

class Control extends React.Component {
  render() {
    let elm = this.props.questions.map(({ question, answers, correct, stt }) =>{
      return (
            <QuestionsList
              question={question}
              answers={answers}
              stt={stt}
              choice = {this.computeAnswer}
              correct ={correct}
            />
          )}
        )
    return <div>elm</div>;
  }
}
export default Control;
